import React, { useState } from 'react';

const Form = () => {
	const [username, setUsername] = useState('');
	const handleSubmit = e => {
		e.preventDefault();
	};

	const handleChangeUsername = e => {
		setUsername(e.target.value);
	};
	const handleChangeEmail = e => {
		setUsername(e.target.value);
	};
	const handleChangePassword = e => {
		setUsername(e.target.value);
	};

	return (
		<form onSubmit={handleSubmit}>
			<div>
				<label htmlFor='name'>
					Wpisz tutaj swoje imie
					<input
						value={username}
						type='text'
						id='name'
						onChange={handleChangeUsername}
					/>
				</label>
			</div>
			<div>
				<label htmlFor='email'>
					Wpisz tutaj swój email
					<input type='text' id='email' onChange={handleChangeEmail} />
				</label>
			</div>
			<div>
				<label htmlFor='password'>
					Wpisz tutaj swoje hasło
					<input type='text' id='password' onChange={handleChangePassword} />
				</label>
			</div>
			<div>
				<label htmlFor='regulamin'>
					<input type='checkbox' id='regulamin' />
					Zapoznałem się z regulaminem
				</label>
			</div>
			<button onClick={handleClick} type='submit'>
				Wyślij zapytanie
			</button>
		</form>
	);
};

export default Form;
